import React from 'react'
import st from './cards.module.css';

function Cards({ data, text}) {


   const filterCard = data.filter((card) => {  
    return card.title.toLowerCase() == text.toLowerCase()  
  }) 

  function fCard() {

    filterCard.length === 0 ?  data.map((elem, index) => (

              <div key={index} className={st.card}>
                  <div className={st.emoji}>{elem.symbol}</div>
          <h3 >{elem.title}</h3>
          <p>{elem.keywords}</p>
        </div>
      )) : filterCard.map((elem, index) => (

              <div key={index} className={st.card}>
                  <div className={st.emoji}>{elem.symbol}</div>
          <h3 >{elem.title}</h3>
          <p>{elem.keywords}</p>
        </div>
      ))
  }


  return (
    <main>


      {data.map((elem, index) => (

              <div key={index} className={st.card}>
                  <div className={st.emoji}>{elem.symbol}</div>
          <h3 >{elem.title}</h3>
          <p>{elem.keywords}</p>
        </div>
      ))}
    </main>
  )
}

export default Cards
